#include <iostream>
#include <algorithm>
using namespace std;

int main()
{
    int r, g, b;
    cin >> r >> g >> b;
    int ans = 0;
    for (int i = 0; i <= r; i++)
    {
        for (int j = 0; j <= g; j++)
        {
            for (int k = 0; k <= b; k++)
            {
                if (i + j + k == 3)
                {
                    ans = max(ans, i + j + k);
                }
            }
        }
    }
    cout << ans << endl;
    return 0;
}
























































































































































































































































































































































































































































































































































































































































































































